interface IBEP20 {
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function approve(address spender, uint256 amount) external returns (bool);
    function increaseAllowance(address spender, uint256 addedValue) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

interface InterfaceSyrupPool {
    //function initialize(IBEP20 _stakedToken, IBEP20 _rewardToken, uint256 _rewardPerBlock, uint256 _startBlock, uint256 _bonusEndBlock, uint256 _poolLimitPerUser, address _admin) external;
    function deposit(uint256 _amount) external;
    function withdraw(uint256 _amount) external;
    //function emergencyWithdraw() external;
    //function emergencyRewardWithdraw(uint256 _amount) external;
    //function recoverWrongTokens(address _tokenAddress, uint256 _tokenAmount) external;
    //function stopReward() external;
    //function updatePoolLimitPerUser(bool _hasUserLimit, uint256 _poolLimitPerUser) external;
    //function updateRewardPerBlock(uint256 _rewardPerBlock) external;
    //function updateStartAndEndBlocks(uint256 _startBlock, uint256 _bonusEndBlock) external;
    function pendingReward(address _user) external view returns (uint256);
    //function _updatePool() internal;
    //function _getMultiplier(uint256 _from, uint256 _to) internal view returns (uint256);
}

interface IBeefy {
    function beefIn (address beefyVault, uint256 tokenAmountOutMin, address tokenIn, uint256 tokenInAmount) external;
}


contract Aggregator {
    mapping(address => UserInfo) public userInfo;

    struct UserInfo {
        uint256 amount; // How many staked tokens the user has provided
        uint256 rewardDebt; // Reward debt
    }


    uint rewardTokenSupplyNew = 0;
    uint rewardTokenSupplyOld = 0;
    //uint lastRewardBlock;
    address contractAddress = address(this);
    address public immutable owner;
    bool firststake = true;
    address bankAddress = 0xF977814e90dA44bFA03b6295A0616a897441aceC;
//    address wbnbAddress = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;

    address cakeAddress = 0x0E09FaBB73Bd3Ade0a17ECC321fD13a19e81cE82;
    address whaleCake = 0xD6216fC19DB775Df9774a6E33526131dA7D19a2c;
    address masterChef = 0x73feaa1eE314F8c655E354234017bE2193C9E24E;
    address reward = 0x2D26e4b9a5F19eD5BB7AF221DC02432D31DEB4dA;

    address rewardTokenAddress = 0x8519EA49c997f50cefFa444d240fB655e89248Aa;
    IBEP20 cakeToken = IBEP20(cakeAddress);
    IBEP20 rewardToken = IBEP20(rewardTokenAddress);

    mapping(uint => uint ) public dummyCounter;

    mapping(address => uint) public user_reward_earned;
    mapping(address => uint) public user_stakedcake;


    uint stakedCakeAll;
    //mapping used to iterate efficiently over users
    address[] public stakers;
    //uint stakers =0;
    mapping (address => bool) public Wallets;

    function setWallet(address _wallet) public{
        Wallets[_wallet]=true;
    }


    function alreadyStaked(address _wallet) public returns (bool){
        return Wallets[_wallet];
    }

    constructor() public {
        owner = msg.sender;
    }


    //asynchronous waiting for transferal(to this contract) and approval(to deposit into RewardPool) of cake
    modifier Transfered(uint _amount, address _rewardpoolAddress){
        //require(cakeToken.allowance(address.this)>=amount, "asd3")
        require(cakeToken.transferFrom(msg.sender, address(this), _amount)==true, "asd2");
        _;
    }

    modifier Approved (uint _amountCake, address _rewardpoolAddress){
        dummy(1,3);
        bool asd = cakeToken.increaseAllowance(_rewardpoolAddress, _amountCake);
        require(asd, "asd4");
        dummy(2,3);
        require(cakeToken.transferFrom(msg.sender, address(this), _amountCake), "asd2");
        dummy(3,3);
        _;
        dummy(3,3);
    }

    function _updateRewards() internal {
        //calculates the pending rewards per user
        /*if (block.number <= lastRewardBlock) {
            return;
        }

        if (stakedCakeAll == 0) {
            lastRewardBlock = block.number;
            return;
        }*/
        uint to_split;
        rewardTokenSupplyNew = rewardToken.balanceOf(address(this));

        to_split = rewardTokenSupplyNew - rewardTokenSupplyOld;

        rewardTokenSupplyOld = rewardTokenSupplyNew;
        for(uint i=0; i<stakers.length; i++){
            user_reward_earned[stakers[i]]+= (to_split*(user_stakedcake[stakers[i]]*1000/stakedCakeAll)/1000);
            //alreadycake = alreadycake(user) + pendingReward(gesamt)/(stakedcake(gesamt)/stakedcake(user))
        }

        //accTokenPerShare = accTokenPerShare.add(cakeReward.mul(PRECISION_FACTOR).div(stakedTokenSupply));
        //lastRewardBlock = block.number;
    }



    function depositIntoAPRPool(uint _amountCake, address _rewardpoolAddress) external {//Transfered(_amountCake, _rewardpoolAddress){

        require(cakeToken.transferFrom(address(msg.sender), address(this), _amountCake), "aua1");

        InterfaceSyrupPool(_rewardpoolAddress).deposit(_amountCake);


        _updateRewards();
        stakedCakeAll += _amountCake;
        if(!alreadyStaked(msg.sender)){
            setWallet(msg.sender);
            stakers.push(msg.sender);
        }
        //UserInfo storage user = userInfo[msg.sender];
        //user.amount = user.amount + _amountCake;

        user_stakedcake[msg.sender] +=_amountCake;
    }

    function withdrawPool(uint _amount, address _rewardpoolAddress) public {
        //require(alreadyStaked(msg.sender),"not staked");
        InterfaceSyrupPool(_rewardpoolAddress).withdraw(_amount);
        _updateRewards();
        rewardTokenSupplyOld -= user_reward_earned[msg.sender];
        require(user_reward_earned[msg.sender]<rewardToken.balanceOf(address(this)), "auer");
        require(rewardToken.transfer(msg.sender, user_reward_earned[msg.sender]),"sedf4");
        user_reward_earned[msg.sender] =0;
        require(cakeToken.transfer(msg.sender, _amount),"asdasdasd");
        user_stakedcake[msg.sender] -= _amount;
        stakedCakeAll -= _amount;

    }

    function dummy(uint asd1, uint asd2) public{
        dummyCounter[asd1]=asd2;
    }
     function getUserReward(address asd) external view returns (uint256) {
      // getting balance of `bankAddress` on the WBNB contract
        return user_reward_earned[asd];
    }
    function getRewardsOld() external view returns (uint256) {
      // getting balance of `bankAddress` on the WBNB contract
        return rewardTokenSupplyOld;
    }
    function getRewardsNew() external view returns (uint256) {
      // getting balance of `bankAddress` on the WBNB contract
        return rewardTokenSupplyNew;
    }
    function getSplit(address asd) external view returns (uint256) {
      // getting balance of `bankAddress` on the WBNB contract
        return (rewardToken.balanceOf(address(this)) *(user_stakedcake[asd]*100/stakedCakeAll)/100);
    }
    function getStakers() external view returns (address  [] memory) {
      // getting balance of `bankAddress` on the WBNB contract
        return stakers;
    }
    function transferFromons(uint _amountCake) public returns (bool) {
        bool asd = cakeToken.transferFrom(msg.sender, address(this), _amountCake);
        return asd;
    }

    function approveFromons(uint _amountCake, address _rewardpoolAddress) public returns (bool) {
        bool asdf = cakeToken.approve(_rewardpoolAddress, _amountCake);
        return asdf;
    }

    //function readSplitRatio() public view returns 

}
